import './offers.css';
import pic1 from './objects/shopy.jpg'
function Offers(){
return(
<div className="offer">
  <div className="leftpart">
  <h1 className="main-heading">EXCLUSIVE OFFERS</h1>
  <p>Get the best deals and discounts on our exclusive products!</p>
  <button>CHECK NOW</button>
  </div>
  <div className="rightpart">
    <img src={pic1}/>
  </div>
</div>

);

}
export default Offers;
